          <div class="col-lg-0">

          </div>
          <div class="col-lg-0">
            <h1 class="font-weight-heavy">AI Games Played</h1>

          </div>
        </div>
      </div>

    <br></br>
    <iframe title="Tab1" width="1000" height="1000px" src="https://public.tableau.com/views/Book2_16466462420050/Sheet1?:embed=y&:display_count=yes&:showVizHome=no">
    </iframe>
    <br></br>
    <iframe title="Tab2" width="1000" height="500px" src="https://public.tableau.com/views/Book2_1_16466464238500/Sheet2?:embed=y&:display_count=yes&:showVizHome=no">
    </iframe>
    </div>
  );
}

export default AdAI;
